        private static List<OrderDetail> _orderDetails;

        public static List<OrderDetail> OrderDetails
        {
            get
            {
                if (_orderDetails == null || _orderDetails.Count == 0)
                    Init();
                return _orderDetails;
            }
            set
            {
                _orderDetails = value;
            }
        }

        public OrderDetailService()
        {
        }

        public ItemsDTO<OrderDetail> GetOrderDetailsGridRows(Action<IGridColumnCollection<OrderDetail>> columns, QueryDictionary<StringValues> query)
        {
            var server = new GridCoreServer<OrderDetail>(OrderDetails, query, true, "orderDetailsGrid", columns)
                .WithPaging(10)
                .Sortable()
                .Filterable()
                .WithMultipleFilters()
                .WithGridItemsCount()
                .Groupable(true)
                .Searchable(true, false, false);

            var items = server.ItemsToDisplay;
            return items;
        }

        public ItemsDTO<OrderDetail> GetOrderDetailsGridRows(Action<IGridColumnCollection<OrderDetail>> columns,
            object[] keys, QueryDictionary<StringValues> query)
        {
            int orderId;
            int.TryParse(keys[0].ToString(), out orderId);

            var server = new GridCoreServer<OrderDetail>(OrderDetails.Where(o => o.OrderID == orderId), query, true, "orderDetailsGrid", columns)
                .WithPaging(10)
                .Sortable()
                .Filterable()
                .WithMultipleFilters()
                .WithGridItemsCount()
                .Groupable(true)
                .Searchable(true, false, false);

            var items = server.ItemsToDisplay;
            return items;
        }

        public async Task<OrderDetail> Get(params object[] keys)
        {
            int orderId;
            int.TryParse(keys[0].ToString(), out orderId);
            int productId;
            int.TryParse(keys[1].ToString(), out productId);
            var orderDetail = OrderDetails.SingleOrDefault(r => r.OrderID == orderId && r.ProductID == productId);
            return await Task.FromResult(orderDetail);
        }

        public async Task Insert(OrderDetail item)
        {
            var orderDetail = OrderDetails.SingleOrDefault(r => r.OrderID == item.OrderID && r.ProductID == item.ProductID);
            if (orderDetail == null)
            {
                item.Product = ProductService.Products.SingleOrDefault(r => r.ProductID == item.ProductID);

                OrderDetails.Add(item);
                await Task.CompletedTask;
            }
            else
            {
                throw new GridException("DETSRV-01", "Error creating the order detail");
            }
        }

        public async Task Update(OrderDetail item)
        {
            var orderDetail = OrderDetails.SingleOrDefault(r => r.OrderID == item.OrderID && r.ProductID == item.ProductID);
            if (orderDetail != null)
            {
                item.Product = ProductService.Products.SingleOrDefault(r => r.ProductID == item.ProductID);

                orderDetail = item;
                await Task.CompletedTask;
            }
            else
            {
                throw new GridException("DETSRV-02", "Error updating the order detail");
            }
        }

        public async Task Delete(params object[] keys)
        {
            var orderDetail = await Get(keys);
            if (orderDetail != null)
            {
                OrderDetails.Remove(orderDetail);
            }
            else
            {
                throw new GridException("DETSRV-03", "Error deleting the order detail");
            }
        }

